import React, { Component } from 'react';
import './App.css';
import Flexbox from 'flexbox-react'

class Box extends Component {
  render(){
    let { value, handleClick } = this.props
    return (
      <Flexbox onClick={handleClick}>
          {value}
      </Flexbox>
    )
  }
}

export default Box;
